insert into SCORE (SCORE_CD, SCORE_NAME, SCORE_DESC, MODEL_CD, ENTY_TYPE_CD, SCORE_LVL_NUM, CRT_USER_ID, CRT_TMSTMP) values ('CLA_RISK', 'Normalized Claimant Risk', 'Overall risk score assigned to a Claimant based on the Shared IP, Changing IP, Contagion Risk, Claimant Location Risk, New Hire Risk, Employer Location Risk, and QWR Scores.', 'APM', 'CLAIMT', 1, 'mnicholson@ntelx.com', '2016-06-03 16:17:16');
insert into SCORE (SCORE_CD, SCORE_NAME, SCORE_DESC, MODEL_CD, PARNT_SCORE_CD, ENTY_TYPE_CD, SCORE_LVL_NUM, CURR_SCORE_WGT_VAL, CRT_USER_ID, CRT_TMSTMP) values ('IPA_SHIP', 'Shared IP', 'IP Addresses that have been shared by multiple unique users are more risky. A score of 0-100 is assigned based on the number of unique users with which a Claimant''s IP Address has been used. In order to receive a non-zero score, the Claimant must have shared an IP Address with another Claimant in the same Claim week. A score of “5” indicates that the Claimant is in the bottom 5th percentile for the number of unique users sharing their IP Address. A score of “10” indicates that the Claimant is in the 5th – 10th percentile for number of unique users sharing their IP Address, and so on up to a score of 100.', 'IPA', 'CLA_RISK', 'CLAIMT', 2, 100, 'mnicholson@ntelx.com', '2016-06-03 16:17:16');
insert into SCORE (SCORE_CD, SCORE_NAME, SCORE_DESC, MODEL_CD, PARNT_SCORE_CD, ENTY_TYPE_CD, SCORE_LVL_NUM, CURR_SCORE_WGT_VAL, CRT_USER_ID, CRT_TMSTMP) values ('IPA_CHIP', 'Changing IP', 'Claimants who file claims from different IP Addresses (ostensibly indicating a change in their filing location) are more risky. A score of 0-100 is assigned based on the number of unique IP Addresses a Claimant has filed from. For an IP Address to be considered “different” from another, it must different on at least the third series of period-separated numbers (i.e. 10.293.122.139 and 10.293.122.80 would not be flagged as different IPs, but 10.293.122.139 and 10.293.173.80 would be considered different). A score of “5” indicates that the Claimant is in the bottom 5th percentile for number of IP Address changes. A Score of “10” indicates that the Claimant is in the 5th-10th percentile for number of IP Address changes, and so on, up to a score of 100.', 'IPA', 'CLA_RISK', 'CLAIMT', 2, 100, 'mnicholson@ntelx.com', '2016-06-03 16:17:16');
insert into SCORE (SCORE_CD, SCORE_NAME, SCORE_DESC, MODEL_CD, PARNT_SCORE_CD, ENTY_TYPE_CD, SCORE_LVL_NUM, CURR_SCORE_WGT_VAL, CRT_USER_ID, CRT_TMSTMP) values ('IPA_CLR', 'Claimant Location Risk', 'Based on the knowledge that Claims filed farther away from the Filing State are more risky than those filed within the Filing state, the Location Risk score assigns risk based on the geolocation of the IP Address from which the Claim was filed. In order to receive a score, a Claimant’s IP Location (at the state level) MUST different from the address they have on file. The scoring is performed as follows:
insert into SCORE (SCORE_CD, SCORE_NAME, SCORE_DESC, MODEL_CD, PARNT_SCORE_CD, ENTY_TYPE_CD, SCORE_LVL_NUM, CURR_SCORE_WGT_VAL, CRT_USER_ID, CRT_TMSTMP) values ('IPA_ELR', 'Employer Location Risk', 'Risk based on whether the IP Address from which the Claimant filed, was previously used by an Employer. A score of “0” indicates that the Claimant has never filed from an IP Address associated with an Employer. A score of “100” indicates that a Claimant has previously filed from an IP Address associated with an Employer.', 'IPA', 'CLA_RISK', 'CLAIMT', 2, 100, 'mnicholson@ntelx.com', '2016-06-03 16:17:16');
