insert into SCORE (SCORE_CD, SCORE_NAME, SCORE_DESC, MODEL_CD, PARNT_SCORE_CD, ENTY_TYPE_CD, SCORE_LVL_NUM, CRT_USER_ID, CRT_TMSTMP) values ('IPA_ELR_PCT', 'Employer Location Risk Percentage', 'Employer Location Risk Percentage', 'IPA', 'IPA_ELR', 'CLAIMT', 3, 'bmorrison@ntelx.com', '2016-06-03 16:17:16');
insert into SCORE (SCORE_CD, SCORE_NAME, SCORE_DESC, MODEL_CD, PARNT_SCORE_CD, ENTY_TYPE_CD, SCORE_LVL_NUM, CURR_SCORE_WGT_VAL, CRT_USER_ID, CRT_TMSTMP) values ('NWC_COR', 'Contagion Risk', 'This score assigns risk to Employees of a company based on the ration of known fraudsters to total Employees at that Company. Scores are normalized to a 0-100 scale, and time decayed exponentially. A high score indicates a Claimant who has a very risky work history in the recent past.', 'NWC', 'CLA_RISK', 'CLAIMT', 2, 100, 'mnicholson@ntelx.com', '2016-06-03 16:17:16');
insert into SCORE (SCORE_CD, SCORE_NAME, SCORE_DESC, MODEL_CD, PARNT_SCORE_CD, ENTY_TYPE_CD, SCORE_LVL_NUM, CURR_SCORE_WGT_VAL, CRT_USER_ID, CRT_TMSTMP) values ('NHI_NHR', 'New Hire Risk', 'The percentage of the Weekly Benefit Amount (WBA) that an individual receives in benefits within two months of appearing on the list of New Hires. ', 'NHI', 'CLA_RISK', 'CLAIMT', 2, 100, 'mnicholson@ntelx.com', '2016-06-03 16:17:16');
insert into SCORE (SCORE_CD, SCORE_NAME, SCORE_DESC, MODEL_CD, PARNT_SCORE_CD, ENTY_TYPE_CD, SCORE_LVL_NUM, CURR_SCORE_WGT_VAL, CRT_USER_ID, CRT_TMSTMP) values ('QWR_QWR', 'QWR', 'This score compares a Claimant''s wages (as reported by Employers) against the Claimant''s reported earnings. Higher scores are associated with a larger difference between the two, taking into account the number of claimed weeks, and also slightly raising the score for $0 earnings weeks.', 'QWR', 'CLA_RISK', 'CLAIMT', 2, 100, 'mnicholson@ntelx.com', '2016-06-03 16:17:16');
